function get_elements(a){var b=document.querySelectorAll(a);return 1==b.length?b[0]:b}function toggleClass(a,b){a.className.match(b)?a.className=a.className.replace(b,""):a.className=a.className+" "+b}function addClass(a,b){a.className.match(b)||(a.className=a.className+" "+b)}function removeClass(a,b){a.className.match(b)&&(a.className=a.className.replace(b,""))}function insertAfter(a,b){b.parentNode.insertBefore(a,b.nextSibling)}jQuery(document).ready(function(a){var b=location.origin+location.pathname;a("#top-nav a").each(function(){var c=a(this).attr("href");c.match(b)&&a(this).addClass("active")})});